function Header(){
    return(
        <div>
            <nav class="navbar bg-body-tertiary">
                <div class="container-fluid">
                    <a class="navbar-brand" href="#">
                    <img src="https://e7.pngegg.com/pngimages/294/851/png-clipart-recycling-symbol-plastic-recycling-logo-e-waste-s-leaf-text-thumbnail.png" alt="Logo" width="30" height="24" class="d-inline-block align-text-top" />

                    </a>
                </div>
            </nav>
        </div>
    )
}

export default Header;
